SET FOREIGN_KEY_CHECKS=0;
SET NAMES utf8mb4;
SET sql_notes = 0;

DROP TABLE IF EXISTS employee_territories;
CREATE TABLE employee_territories (
  employee_id INT NOT NULL,
  territory_id VARCHAR(20) NOT NULL,
  PRIMARY KEY (employee_id, territory_id),
  FOREIGN KEY (employee_id) REFERENCES employees(employee_id),
  FOREIGN KEY (territory_id) REFERENCES territories(territory_id)
);

DROP TABLE IF EXISTS order_details;
CREATE TABLE order_details (
  order_id INT NOT NULL,
  product_id INT NOT NULL,
  unit_price DECIMAL(10,2) NOT NULL DEFAULT 0,
  quantity INT,
  discount DECIMAL(4,2),
  PRIMARY KEY (order_id, product_id),
  FOREIGN KEY (order_id) REFERENCES orders(order_id),
  FOREIGN KEY (product_id) REFERENCES products(product_id)
);

DROP TABLE IF EXISTS orders;
CREATE TABLE orders (
  order_id INT AUTO_INCREMENT PRIMARY KEY,
  customer_id VARCHAR(10),
  employee_id INT,
  order_date DATETIME,
  required_date DATETIME,
  shipped_date DATETIME,
  ship_via INT,
  freight DECIMAL(10,2) DEFAULT 0,
  ship_name VARCHAR(255),
  ship_address VARCHAR(255),
  ship_city VARCHAR(100),
  ship_region VARCHAR(100),
  ship_postal_code VARCHAR(20),
  ship_country VARCHAR(50),
  FOREIGN KEY (employee_id) REFERENCES employees(employee_id),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id),
  FOREIGN KEY (ship_via) REFERENCES shippers(shipper_id)
);

DROP TABLE IF EXISTS products;
CREATE TABLE products (
  product_id INT AUTO_INCREMENT PRIMARY KEY,
  product_name VARCHAR(255) NOT NULL,
  supplier_id INT,
  category_id INT,
  quantity_per_unit VARCHAR(100),
  unit_price DECIMAL(10,2) DEFAULT 0,
  units_in_stock INT DEFAULT 0,
  units_on_order INT DEFAULT 0,
  reorder_level INT DEFAULT 0,
  discontinued TINYINT(1),
  FOREIGN KEY (supplier_id) REFERENCES suppliers(supplier_id),
  FOREIGN KEY (category_id) REFERENCES categories(category_id)
);

DROP TABLE IF EXISTS territories;
CREATE TABLE territories (
  territory_id VARCHAR(20) NOT NULL PRIMARY KEY,
  territory_description VARCHAR(100) NOT NULL,
  region_id INT NOT NULL,
  FOREIGN KEY (region_id) REFERENCES regions(region_id)
);

DROP TABLE IF EXISTS regions;
CREATE TABLE regions (
  region_id INT NOT NULL PRIMARY KEY,
  region_description VARCHAR(100) NOT NULL
);

DROP TABLE IF EXISTS shippers;
CREATE TABLE shippers (
  shipper_id INT AUTO_INCREMENT PRIMARY KEY,
  company_name VARCHAR(255) NOT NULL,
  phone VARCHAR(50)
);

DROP TABLE IF EXISTS customers;
CREATE TABLE customers (
  customer_id VARCHAR(10) PRIMARY KEY,
  company_name VARCHAR(255) NOT NULL,
  contact_name VARCHAR(255),
  contact_title VARCHAR(255),
  address VARCHAR(255),
  city VARCHAR(100),
  region VARCHAR(100),
  postal_code VARCHAR(20),
  country VARCHAR(50),
  phone VARCHAR(50),
  fax VARCHAR(50)
);

DROP TABLE IF EXISTS employees;
CREATE TABLE employees (
  employee_id INT AUTO_INCREMENT PRIMARY KEY,
  last_name VARCHAR(255),
  first_name VARCHAR(255),
  title VARCHAR(255),
  title_of_courtesy VARCHAR(100),
  birth_date DATE,
  hire_date DATE,
  address VARCHAR(255),
  city VARCHAR(100),
  region VARCHAR(100),
  postal_code VARCHAR(20),
  country VARCHAR(50),
  home_phone VARCHAR(50),
  extension VARCHAR(10),
  reports_to INT
);

DROP TABLE IF EXISTS suppliers;
CREATE TABLE suppliers (
  supplier_id INT AUTO_INCREMENT PRIMARY KEY,
  company_name VARCHAR(255) NOT NULL,
  contact_name VARCHAR(255),
  contact_title VARCHAR(255),
  address VARCHAR(255),
  city VARCHAR(100),
  region VARCHAR(100),
  postal_code VARCHAR(20),
  country VARCHAR(50),
  phone VARCHAR(50),
  fax VARCHAR(50),
  home_page TEXT
);

DROP TABLE IF EXISTS categories;
CREATE TABLE categories (
  category_id INT AUTO_INCREMENT PRIMARY KEY,
  category_name VARCHAR(255),
  description TEXT
);














